import satelite from '../src/img/satelite.png'
import stalite_broken from '../src/img/satelite_broken.png'
import planet from '../src/img/planet_blue.png'
import sun from '../src/img/sun.png'
import { Component } from 'react';
import Change_component from './Change_component';


export default class Home_component extends Component {

    render(){
      
    return (
      <div className="Home_component body">
        <div className="Home_component_header">
              
              <div className='planet spin_right'>
                  <img src = {planet} alt={"planet"}></img>
              </div>
              <div className='sun'>
                  <img src = {sun} alt={"sun"}></img>
              </div>      
              <div className="satelite spin_left spin_onSome">
                  <img src = {satelite}  alt={"satelite"}></img>
              </div>
                  
                
        </div>
      </div>
    );
  }
}
